import Header from "../assets/header"; // Ensure correct import path
import Carousel from "../assets/carousel"; // Ensure correct import path
import "./App.css"; // Import the styles

const Home = () => {
  return (
    <div className="page-container">
      <div id="header">
        <Header />
      </div>

      <div id="carousel">
        <Carousel />
      </div>
    </div>
  );
};

export default Home;
